import React, { Component } from 'react';
import Nav from "../components/Nav";
import  Video from "../components/video/1.mp4";
import  Video2 from "../components/video/2.mp4";
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import {Container,Row,Col} from 'react-bootstrap/'
import {
    MainButton
  } from "../components/Atribut";

export default function Popup(props) {

        const { title, children, openPopup, setOpenPopup } = props;
        return (
            <div>
                <div className="home">
                <Nav/>
                <Container>
                    <Row className="wrapper">
                        <Col sm={6}>
                            <h1 style={{fontSize: "7vw"}}>Bersuara.</h1>
                            <h3 style={{lineHeight: "4vw"}} >promote your talent</h3>
                            <MainButton style={{marginTop: "2vw"}} type="submit">Cari Talent Di sini<ExpandMoreIcon/></MainButton>
                            <h2 style={{marginTop: "6vw"}} >“The only thing better than singing is more singing” —Ella Fitzgerald </h2>
                        </Col>
                        <Col sm={3}>
                            <video controls autostart autoPlay src={Video} type="video/mp4" />
                        </Col>  
                        <Col sm={3}>
                            <div className="video-bg mt-5">
                            <video controls autostart autoPlay src={Video2} type="video/mp4" />
                            </div>
                        </Col>  
                    </Row>
                </Container>
                </div>

            </div>
          )
}
